import './App.css';
import React,{ useEffect, useState } from 'react';
import Navbar from './components/Navbar'
import {BrowserRouter as Router,Switch,Route} from 'react-router-dom';
import Users from './pages/Users';
import Home from './pages/Home';



function App() {

  return (
    <Router>
      <div className="App">
        <Navbar/>
        <Switch>

          <Route path="/" exact> 
            <Home/>
          </Route>

          <Route path="/movies"> 
          <Movies/>
          </Route>

          <Route path="/users">
            <Users/>
          </Route>


        </Switch>
      </div>
    </Router>

  );
}

export default App;
